const theme = {
  colors: {
    background: '#454d66',     // Midnight Black (background)
    text: '#FFFFFF',           // White (text)
    primary: '#454d66',        // Electric Blue (primary)
    secondary: '#efeeb4',      // Bright Orange (secondary)
    accent: '#dad873',         // Emerald Green (accent)
    cta: '#309975',            // Tango Red (call to action)
    accent2: '#58b368',        // Amethyst Purple (additional accent)
  },
};

export default theme;
